    }


    componentDidMount(){
        axios.get("https://jsonplaceholder.typicode.com/posts")
        .then(res => {
            console.log(res.data);
        })
    }


    render() {
        return (
            <div>
                <div className="container mt-5 pt-5">
                    <div className="row">
                        
                    </div>
                </div>
            </div>
        )
    }
}

export default Audi
